criteria.textblock:
        Inclusion Criteria:

          -  A person is eligible for inclusion in the study if they:

               1. Are at least 18 years of age and have full legal capacity to volunteer;

               2. Have read and signed an information consent letter;

               3. Are willing and able to follow instructions and maintain the appointment
                  schedule;

               4. Are an adapted soft contact lens wearer;

               5. Require spectacle lens powers in both eyes;

                    1. Sphere: between -1.75 to -6.00 diopters and

                    2. Astigmatism: between -1.00 to -2.25 and

                    3. Axis: 180 Â± 20 degrees

               6. Are willing to wear contact lenses in both eyes;

               7. Have manifest refraction visual acuities (VA) equal to or better than logMAR (log
                  of the minimum angle of resolution) equivalent of 20/25 in each eye;

               8. To be eligible for lens dispensing, the subject must have VA of logMAR equivalent
                  of 20/30 or better in each eye with the study lenses and the investigator must
                  judge the fit including toric orientation as acceptable.

        Exclusion Criteria:

          -  A person will be excluded from the study if they:

               1. Are participating in any concurrent clinical or research study;

               2. Have any known active* ocular disease and/or infection;

               3. Have a systemic condition that in the opinion of the investigator may affect a
                  study outcome variable;

               4. Are using any systemic or topical medications that in the opinion of the
                  investigator may affect a study outcome variable;

               5. Have known sensitivity to the diagnostic pharmaceuticals to be used in the study;

               6. Are pregnant, lactating or planning a pregnancy at the time of enrolment (by
                  verbal confirmation at the screening visit);

               7. Are aphakic;

               8. Have undergone refractive error surgery;
